void poll_ocm::thread_ap_clk_no_reset_() {
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        ap_CS_fsm = ap_ST_fsm_state1;
    } else {
        ap_CS_fsm = ap_NS_fsm.read();
    }
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        ap_reg_ioackin_ADDR_BUS_ARREADY = ap_const_logic_0;
    } else {
        if ((esl_seteq<1,1,1>(ap_const_lv1_1, ap_CS_fsm_state2.read()) && esl_seteq<1,1,1>(or_cond_fu_148_p2.read(), ap_const_lv1_0))) {
            if (!(esl_seteq<1,1,1>(or_cond_fu_148_p2.read(), ap_const_lv1_0) && esl_seteq<1,1,1>(ap_const_logic_0, ap_sig_ioackin_ADDR_BUS_ARREADY.read()))) {
                ap_reg_ioackin_ADDR_BUS_ARREADY = ap_const_logic_0;
            } else if (esl_seteq<1,1,1>(ap_const_logic_1, ADDR_BUS_ARREADY.read())) {
                ap_reg_ioackin_ADDR_BUS_ARREADY = ap_const_logic_1;
            }
        }
    }
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        ap_reg_ioackin_ADDR_BUS_AWREADY = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_lv1_1, ap_CS_fsm_state10.read())) {
            if (!esl_seteq<1,1,1>(ap_const_logic_0, ap_sig_ioackin_ADDR_BUS_AWREADY.read())) {
                ap_reg_ioackin_ADDR_BUS_AWREADY = ap_const_logic_0;
            } else if (esl_seteq<1,1,1>(ap_const_logic_1, ADDR_BUS_AWREADY.read())) {
                ap_reg_ioackin_ADDR_BUS_AWREADY = ap_const_logic_1;
            }
        }
    }
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        ap_reg_ioackin_ADDR_BUS_WREADY = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_lv1_1, ap_CS_fsm_state11.read())) {
            if (!esl_seteq<1,1,1>(ap_const_logic_0, ap_sig_ioackin_ADDR_BUS_WREADY.read())) {
                ap_reg_ioackin_ADDR_BUS_WREADY = ap_const_logic_0;
            } else if (esl_seteq<1,1,1>(ap_const_logic_1, ADDR_BUS_WREADY.read())) {
                ap_reg_ioackin_ADDR_BUS_WREADY = ap_const_logic_1;
            }
        }
    }
    if ((esl_seteq<1,1,1>(ap_const_lv1_1, ap_CS_fsm_state2.read()) && 
         esl_seteq<1,1,1>(or_cond_fu_148_p2.read(), ap_const_lv1_0) && 
         !(esl_seteq<1,1,1>(or_cond_fu_148_p2.read(), ap_const_lv1_0) && esl_seteq<1,1,1>(ap_const_logic_0, ap_sig_ioackin_ADDR_BUS_ARREADY.read())))) {
        mem_index_phi5_fu_72 = adjSize6_reg_169.read();
    } else if ((esl_seteq<1,1,1>(ap_CS_fsm_state1.read(), ap_const_lv1_1) && 
                !esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_0))) {
        mem_index_phi5_fu_72 = ap_const_lv4_0;
    }
    if ((esl_seteq<1,1,1>(ap_const_lv1_1, ap_CS_fsm_state9.read()) && !esl_seteq<1,1,1>(ADDR_BUS_RVALID.read(), ap_const_logic_0))) {
        ADDR_BUS_addr_read_reg_190 = ADDR_BUS_RDATA.read();
    }
    if ((esl_seteq<1,1,1>(ap_CS_fsm_state1.read(), ap_const_lv1_1) && !esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_0))) {
        ADDR_BUS_addr_reg_175 = tmp_2_fu_109_p1.read();
        adjSize6_reg_169 = addr.read().range(5, 2);
        ptr_cmp_reg_181 = ptr_cmp_fu_129_p2.read();
    }
    if ((esl_seteq<1,1,1>(ap_const_lv1_1, ap_CS_fsm_state2.read()) && !(esl_seteq<1,1,1>(or_cond_fu_148_p2.read(), ap_const_lv1_0) && esl_seteq<1,1,1>(ap_const_logic_0, ap_sig_ioackin_ADDR_BUS_ARREADY.read())))) {
        or_cond_reg_186 = or_cond_fu_148_p2.read();
    }
    if ((esl_seteq<1,1,1>(ap_const_lv1_1, ap_CS_fsm_state10.read()) && !esl_seteq<1,1,1>(ap_const_logic_0, ap_sig_ioackin_ADDR_BUS_AWREADY.read()))) {
        temp_reg_195 = temp_fu_157_p2.read();
    }
}

